//RETURNS THE START OR THE BEGINNING OF AN INDEX FOR A CHECKSUM
function getCheckSumSector($type,$a1,$a2,$a3,$a4){
    $index=($a1 * pow(2,24)) + ($a2 * pow(2,16)) + ($a3 * pow(2,8) + $a4);
   $sectorIndex=($type=="end") ? $index + 1 : $index;

    return $sectorIndex;
}

