//rounds a floating number
function conv($cval,$cmode,$csubtractor,$cdivider,$cfactor){
    $hval = ($cmode!=5) ? round(($cval - $csubtractor) * $cdivider / $cfactor) : round($cfactor / $cval);
    return $hval;
}
