function getNumberOfSectors($year, $vin)
{
    // Softail
    if ($vin[4] == 'B' || $vin[4] == 'J') {
        if ($year >= 2007 && $year <= 2010) {
            return 24;
        } elseif ($year == 2011) {
            return 32;
        } else {
            if ($year == 2012 || $year == 2013 || $year == 2014 || $year == 2015) {
                return 40;
            } else {
                if ($year == 2016 || $year == 2017) {
                    return 64;
                }
            }
        }//else
    }//if


    //Dyna
    if ($vin[4] == 'G' || $vin[4] == 'V') {
        if ($vin[4] == 'G' && $vin[5] == 'S') {
            if ($year == 2016 || $year == 2017) {
                return 64;
            }
        }

        if ($year >= 2007 && $year <= 2011) {
            return 24;
        } elseif ($year == 2012 || $year == 2013 || $year == 2014 || $year == 2015 || $year == 2016 || $year == 2017) {
            return 40;
        }
    }


    //Touring
    if ($vin[4] == 'F' ||
        $vin[4] == 'K' ||
        ($vin[4] == 'M' && $vin[5] == 'A') ||
        ($vin[4] == 'M' && $vin[5] == 'B') ||
        ($vin[4] == 'M' && $vin[5] == 'C')
    ) {
        if ($year == 2007) {
            return 24;
        } elseif ($year >= 2008 && $year <= 2013) {
            return 32;
        } elseif ($year == 2014 || $year == 2015 || $year == 2016 || $year == 2017) {
            return 64;
        }
    }


    //Sportster
    if ($vin[4] == 'L' || $vin[4] == 'C') {
        if ($year >= 2007 && $year <= 2013) {
            return 24;
        } else {
            return 40;
        }
    }


    //Street:  CAN based only
    if ((($vin[4] == 'N' && $vin[5] == 'A') && $year == 2015) ||
        (($vin[4] == 'N' && $vin[5] == 'B') && $year == 2015) ||

        (($vin[4] == 'N' && $vin[5] == 'A') && $year == 2016) ||
        (($vin[4] == 'N' && $vin[5] == 'B') && $year == 2016) ||

        (($vin[4] == 'N' && $vin[5] == 'A') && $year == 2017) ||
        (($vin[4] == 'N' && $vin[5] == 'B') && $year == 2017) ||
        (0)
    ) {
        return 40;
    }


    //CVO
    if (($vin[4] == 'T') ||
        ($vin[4] == 'P') ||
        (0)
    ) {
        if ($year == 2014 || $year == 2015 || $year == 2016 || $year == 2017) {
            return 64;
        }
    }

    if ($year == 2008 || $year == 2009 || $year == 2010 || $year == 2011 || $year == 2012 || $year == 2013) {
        return 32;
    }

    if ($year == 2007 ) {
        return 24;
    }

    return 0;

}

function getIntegerFromBinary($f){
    return intval( bin2hex(fread($f,1)),16 );
}

function getAddress($offSets, $f)
{
    $x1 = $offSets;

    fseek($f, $x1[0]);
    $b3 =  getIntegerFromBinary($f);

    fseek($f, $x1[1]);
    $b2 =  getIntegerFromBinary($f);

    fseek($f, $x1[2]);
    $b1 = getIntegerFromBinary($f);

    fseek($f, $x1[3]);
    $b0 = getIntegerFromBinary($f);

    return $b3 * pow(2,24) + $b2 * pow(2,16) + $b1 * pow(2,8) + $b0;

}

    /**
     * @param $fileName
     * @param $vin This parameter is only passed in for logging & customer tracking purposes.
     * @return int
     */
function extractNumberOfSectors($fileName, $vin)
{
    $debug_proc = 1;

    $f = fopen($fileName, 'rb');

    // J1850 offsets
    $offsetStart = array(10,11,12,13);
    $offsetEnd   = array(14,15,16,17);

    $startAddress = getAddress($offsetStart, $f);
    $endAddress   = getAddress($offsetEnd, $f);

    $sector = ($endAddress + 1) - $startAddress;
    $maxSectors = ($sector/256);

    if ($debug_proc == 1) {
        logger_procedural('log_extractNumberOfSectors_' . date('m_d_Y') . '.txt', array(
            'vin'         => $vin,
            "Bus Type"    => "J1850",
            "start"       => $startAddress,
            "end"         => $endAddress,
            "sector"      => $sector,
            "max sectors" => $maxSectors,
        ));
    }

    if ($maxSectors==32 || $maxSectors==24) {

        return get55($f, $sector, $maxSectors);

    } else {

        // CAN offsets
        $offsetStart = array(4,5,6,7);
        $offsetEnd   = array(8,9,10,11);

        $startAddress = getAddress($offsetStart, $f);
        $endAddress   = getAddress($offsetEnd, $f);

        $sector = ($endAddress + 1) - $startAddress;
        $maxSectors = ($sector/256);

        if ($debug_proc == 1) {
            logger_procedural('log_extractNumberOfSectors_' . date('m_d_Y') . '.txt', array(
                'vin'         => $vin,
                "Bus Type"    => "CAN",
                "start"       => $startAddress,
                "end"         => $endAddress,
                "sector"      => $sector,
                "max sectors" => $maxSectors,
            ));
        }

        if ($sector%256 == 0) {
            return get55($f, $sector, $maxSectors);
        }
    }

}

function get55($f, $sector, $maxSectors)
{
    fseek( $f,($sector-1) );

    $b0 = getIntegerFromBinary($f);

    $debug_proc = 1; //1=on  0=off
    if ($debug_proc == 1) {
        logger_procedural('log_get55_' . date('m_d_Y') . '.txt',
            array(
                'sector'     => $sector,
                'maxSectors' => $maxSectors,
                'b0'         => $b0,
            ));
    }



    if($b0 == 0x55) {
        return $maxSectors; // 55 Found!
    } else {
        return 0;   // 55 not Found!
    }
}
