function compareChecksum($fileName, $year, $justCalculate = false, $isTouring = false, $vin)
{

    //$numsec = getNumberOfSectors($year, $vin);
    $numsec = extractNumberOfSectors($fileName, $vin);

    $debug_proc = 1; //1=on  0=off
    if ($debug_proc == 1) {
        logger_procedural('log_compareChecksum_' . date('m_d_Y') . '.txt',
            array(
                'year'   => $year,
                'vin'    => $vin,
                'numsec' => $numsec,
            ));
    }


    $f = fopen($fileName, 'rb');
    $length = $numsec * 256;

    if ($length == 0) {
        return false;
    }


    $summ = 0;
    for ($i = 2; $i < $length; $i++) {
        fseek($f, $i);
        $summ += '0x' . bin2hex(fread($f, 1));
    }
    $summ = (0x0000 - $summ) & 0xFFFF;
    $originalSumm = base_convert('0x' . h($f, 0, 0, 2, 1), 16, 10);
    fclose($f);

    //print_r($originalSumm . ' ' . $summ);
    if ($justCalculate) {
        return $summ;
    }

    if ($summ == $originalSumm) {
        return true;
    } else {
        return false;
    }
}

function encodeFile($mapID, $fileName, $year, $vin, $ecmFirmware)
{
    $number = 0.0;
    $debug_proc = 0; //1=on  0=off


    $map = foo(new \ClickBlocks\DB\ServiceMaps())->getByID($mapID);
    $mapStructure = getMapStructure( $ecmFirmware );
    $f = fopen($fileName, 'rb+');

    foreach ($mapStructure as $key => $value) {

        try {
            $divider = $value['divider'];
            $factor = $value['factor'];
            $subtractor = $value['subtractor'];

            $sectorOffset = $value['sectorOffset'];
            $offset = $value['offset'];
            $width = $value['width'];

            $convmode = $value['convmode'];

            $orchestraClass = '\ClickBlocks\DB\Orchestra' . $value['DBTableName'];

            $data = foo(new $orchestraClass)->getByQuery('mapID = ' . $mapID, null, null, 'row');
            $fval = json_decode($data['data'], 1);
            //var_dump($fval);

            //only table data if it exists in the db.
            //older records do not have data for the 40+ new mysql tables causing errors
            if (!empty($data)) {
                switch ($value['dataType']) {
                    case 'flat':

                        if ($convmode != 5) {
                            $val = round(($fval - $subtractor) * $divider / $factor);
                        } else {
                            $val = round($factor / $fval);
                        }


                        // convert depending on convmode
                        switch ($convmode) {
                            case 1:
                                $msb = ($val >> 8) & 0x00FF;
                                $lsb = $val & 0x00FF;

                                $binmsb = getBinData($msb);
                                $binlsb = getBinData($lsb);
                                break;
                            case 2:
                                //Get the integer part
                                $intpart = floor($val);

                                //Get the fraction part
                                $fraction = ($number - $intpart) * 256;

                                $binmsb = getBinData($intpart);
                                $binlsb = getBinData($fraction);
                                break;

                            case 3:
                                //Get the integer part
                                $intpart = floor($val);

                                //Get the fraction part
                                $fraction = ($number - $intpart) * 100;

                                $binmsb = getBinData($intpart);
                                $binlsb = getBinData($fraction);
                                break;

                            case 4:
                                //Get the integer part
                                $intpart = floor($val);

                                //Get the fraction part
                                $fraction = ($number - $intpart) * 255;

                                $binmsb = getBinData($intpart);
                                $binlsb = getBinData($fraction);
                                break;

                            case 5:
                                $binmsb = getBinData($val);
                                break;

                            case 6:
                                //Get the integer part
                                $intpart = floor($val);

                                //Get lsb from file...

                                $binmsb = getBinData($intpart);
                                break;

                            case 7:
                                $binmsb = getBinData($val);
                                break;
                        }


                        //  1 or 2 bytes storage
                        if ($width == 1) {
                            fseek($f, $sectorOffset * 256 + $offset);
                            fwrite($f, $binmsb);
                        }
                        if ($width == 2) {
                            fseek($f, $sectorOffset * 256 + $offset);
                            fwrite($f, $binmsb);

                            if ($convmode != 6) {
                                fseek($f, $sectorOffset * 256 + $offset + 1);
                                fwrite($f, $binlsb);
                            }
                        }

                        break;
                    case 'table':

                        $index = 0;
                        $rows = count($fval, 1);

                        /*
                        * $fval is serialized json data stored in a php variable.  It needs to be converted to an array.
                        * The array_values() function returns an array containing all the values of an array.
                        * The returned array will have numeric keys, starting at 0 and increase by 1.
                        */
                        $fval = array_values($fval);

                        for ($i = 0; $i < $rows; $i++) {

                            if ($convmode != 5) {
                                $val = round(($fval[ $i ] - $subtractor) * $divider / $factor);
                            } else {
                                $val = round($factor / $fval[ $i ]);
                            }

                            // convert depending on convmode
                            switch ($convmode) {
                                case 1:
                                    $msb = ($val >> 8) & 0x00FF;
                                    $lsb = $val & 0x00FF;

                                    $binmsb = getBinData($msb);
                                    $binlsb = getBinData($lsb);
                                    break;
                                case 2:
                                    //Get the integer part
                                    $intpart = floor($val);
                                    //Get the fraction part
                                    $fraction = ($number - $intpart) * 256;

                                    $binmsb = getBinData($intpart);
                                    $binlsb = getBinData($fraction);
                                    break;
                                case 3:
                                    //Get the integer part
                                    $intpart = floor($val);
                                    //Get the fraction part
                                    $fraction = ($number - $intpart) * 100;

                                    $binmsb = getBinData($intpart);
                                    $binlsb = getBinData($fraction);
                                    break;
                                case 4:
                                    //Get the integer part
                                    $intpart = floor($val);
                                    //Get the fraction part
                                    $fraction = ($number - $intpart) * 255;

                                    $binmsb = getBinData($intpart);
                                    $binlsb = getBinData($fraction);
                                    break;
                                case 5:
                                    $binmsb = getBinData($val);
                                    break;
                                case 6:
                                    //Get the integer part
                                    $intpart = floor($val);

                                    //Get lsb from file...
                                    $binmsb = getBinData($intpart);
                                    break;
                                case 7:
                                    $binmsb = getBinData($val);
                                    break;
                            }


                            //  1 or 2 bytes storage
                            if ($width == 1) {
                                fseek($f, $sectorOffset * 256 + $offset + $index);
                                fwrite($f, $binmsb);
                                $index++;
                            }
                            if ($width == 2) {
                                fseek($f, $sectorOffset * 256 + $offset + $index);
                                fwrite($f, $binmsb);
                                $index++;
                                if ($convmode != 6) {
                                    fseek($f, $sectorOffset * 256 + $offset + $index);
                                    fwrite($f, $binlsb);
                                }
                                $index++;
                            }

                        }  // for - i

                        break;
                    case 'matrix':
                        $dim1 = count($fval);   // count sub arrays
                        $dim2 = count($fval, 1) - $dim1; // count each element

                        $cols = $dim1;
                        $rows = $dim2 / $dim1;


                        for ($i = 0; $i < $rows; $i++) {

                            $index = 0;
                            for ($j = 0; $j < $cols; $j++) {

                                /*
                                * $fval is serialized json data stored in a php variable.  It needs to be converted to an array.
                                * In this case, we are working with multi-dimensional data
                                * The array_values() function returns an array containing all the values of an array.
                                * The returned array will have numeric keys, starting at 0 and increase by 1.
                                */
                                $fval = array_map('array_values', array_values($fval));

                                if ($convmode != 5) {
                                    $fval2 = (($fval[ $j ][ $i ] - $subtractor) * $divider / $factor);
                                } else {
                                    $fval2 = ($factor / $fval[ $j ][ $i ]);
                                }


                                // convert depending on convmode
                                switch ($convmode) {
                                    case 1:
                                        $val = round($fval2);
                                        $msb = ($val >> 8) & 0x00FF;
                                        $lsb = $val & 0x00FF;

                                        $binmsb = getBinData($msb);
                                        $binlsb = getBinData($lsb);
                                        break;
                                    case 2:
                                        //Get the integer part
                                        $intpart = floor($fval2);

                                        //Get the fraction part
                                        $fraction = intval(($fval2 - $intpart) * 256.0);

                                        $binmsb = getBinData($intpart);
                                        $binlsb = getBinData($fraction);
                                        break;

                                    case 3:
                                        //Get the integer part
                                        $intpart = floor($fval2);

                                        //Get the fraction part
                                        $fraction = intval(($fval2 - $intpart) * 100.0);

                                        $binmsb = getBinData($intpart);
                                        $binlsb = getBinData($fraction);
                                        break;

                                    case 4:
                                        //Get the integer part
                                        $intpart = floor($fval2);

                                        //Get the fraction part
                                        //$fraction = ($number - $intpart)*255;
                                        $fraction = intval(($fval2 - $intpart) * 255.0);


                                        $binmsb = getBinData($intpart);
                                        $binlsb = getBinData($fraction);

                                        $fpointer = $sectorOffset * 256 + $offset + ($i * $width * ($value['cols'])) + $index;
                                        break;

                                    case 5:
                                        $val = round($fval2);
                                        $binmsb = getBinData($val);
                                        break;

                                    case 6:
                                        //Get the integer part
                                        $intpart = floor($fval2);

                                        //Get lsb from file...
                                        $binmsb = getBinData($intpart);
                                        break;

                                    case 7:
                                        $val = round($fval2);
                                        $binmsb = getBinData($val);
                                        break;
                                } // switch


                                //  1 or 2 bytes storage
                                if ($width == 1) {
                                    fseek($f, $sectorOffset * 256 + $offset + ($i * ($value['cols']) + $index));
                                    fwrite($f, $binmsb);
                                    $index++;
                                }

                                if ($width == 2) {
                                    fseek($f, $sectorOffset * 256 + $offset + ($i * $width * ($value['cols']) + $index));
                                    fwrite($f, $binmsb);
                                    $index++;


                                    if ($convmode != 6) {
                                        fseek($f, $sectorOffset * 256 + $offset + ($i * $width * ($value['cols']) + $index));
                                        fwrite($f, $binlsb);
                                    }
                                    $index++;
                                }

                            } // for-j columns
                        } // for-i    rows

                        break;
                    default:
                        echo "default case";
                        break;
                }  //switch

            }// if

        } // try
        catch (Exception $ex) {
            echo $ex->getMessage();
        }
    }

    fclose($f);

    if (strtolower($map->model) == 'touring' || strtolower($map->model) == 'cvo') {
        $isTouring = true;
    }


    $checksum = compareChecksum($fileName, $year, true, $isTouring, $vin);

    $f = fopen($fileName, 'rb+');
    fseek($f, 0);
    fwrite($f, getBinData($checksum));
    fclose($f);

} //encodeFile

