                        $msb = 0;

                        if ($width == 1) {
                            $msb = base_convert("0x" . h($f, $v['headers']['X']['sectorOffset'], $v['headers']['X']['offset'] + $ii, 1), 16, 10);
                        }

                        if ($width == 2) {
                            $msb = base_convert("0x" . h($f, $v['headers']['X']['sectorOffset'], $v['headers']['X']['offset'] + ($ii * 2), 1), 16, 10);
                            $lsb = base_convert("0x" . h($f, $v['headers']['X']['sectorOffset'], $v['headers']['X']['offset'] + ($ii * 2 + 1), 1), 16, 10);
                        }


                        // calculate $val depending on convmode
                        $val = 0.0;
                        switch ($convmode) {
                            case 1:
                                $val = ($msb * 256.0) + $lsb;
                                break;
                            case 2:
                                $val = $msb + ($lsb / 256.0);
                                break;
                            case 3:
                                $val = $msb + ($lsb / 100.0);
                                break;
                            case 4:
                                $val = $msb + ($lsb / 255.0);
                                break;
                            case 5:
                                $val = 1 * $msb;
                                break;
                            case 6:
                                $val = $msb;
                                break;
                            case 7:
                                $val = $msb;
                                break;
                            case 8:
                                $val = ($msb * 256.0) + $lsb;
                                break;
                        }


                        // use formula to generate float value and store it
                        if ($convmode != 5) {
                            $fval = round((($factor * $val) / $divider) + $subtractor, $sigdig);
                        } else {
                            $fval = round(($factor / $val), $sigdig);
                        }

                        // store it temporarely
                        $headers['X'][ $ii ] = $fval;

                    }


                    // process Y header
                    $divider = $v['headers']['Y']['divider'];
                    $factor = $v['headers']['Y']['factor'];
                    $subtractor = $v['headers']['Y']['subtractor'];
                    $width = $v['headers']['Y']['width'];
                    $convmode = $v['headers']['Y']['convmode'];
                    $sigdig = $v['headers']['Y']['sigdig'];

                    for ($ii = 0; $ii < $v['headers']['Y']['maxCount']; $ii++) {
                        // fetch 1 or 2 bytes
                        $lsb = 0;
                        $msb = 0;

                        if ($width == 1) {
                            $msb = base_convert("0x" . h($f, $v['headers']['Y']['sectorOffset'], $v['headers']['Y']['offset'] + $ii, 1), 16, 10);
                        }

                        if ($width == 2) {
                            $msb = base_convert("0x" . h($f, $v['headers']['Y']['sectorOffset'], $v['headers']['Y']['offset'] + ($ii * 2), 1), 16, 10);
                            $lsb = base_convert("0x" . h($f, $v['headers']['Y']['sectorOffset'], $v['headers']['Y']['offset'] + ($ii * 2 + 1), 1), 16, 10);
                        }


                        // calculate $val depending on convmode
                        $val = 0.0;
                        switch ($convmode) {
                            case 1:
                                $val = ($msb * 256.0) + $lsb;
                                break;
                            case 2:
                                $val = $msb + ($lsb / 256.0);
                                break;
                            case 3:
                                $val = $msb + ($lsb / 100.0);
                                break;
                            case 4:
                                $val = $msb + ($lsb / 255.0);
                                break;
                            case 5:
                                $val = 1 * $msb;
                                break;
                            case 6:
                                $val = $msb;
                                break;
                            case 7:
                                $val = $msb;
                                break;
                            case 8:
                                $val = ($msb * 256.0) + $lsb;
                                break;
                        }


                        // use formula to generate float value and store it
                        if ($convmode != 5) {
                            $fval = round((($factor * $val) / $divider) + $subtractor, $sigdig);
                        } else {
                            $fval = round(($factor / $val), $sigdig);
                        }

                        // store it temporarely
                        $headers['Y'][ $ii ] = $fval;

                    } //for


                    //**************
                    // process data
                    //**************


                    // initialize variable from mapStructrure
                    $divider = $v['divider'];
                    $factor = $v['factor'];
                    $subtractor = $v['subtractor'];
                    $width = $v['width'];
                    $convmode = $v['convmode'];
                    $sigdig = $v['sigdig'];


                    // dynamically compute X unique column header ( column windowed size)
                    $uniquecount = 0;
                    for ($ii = 1; $ii < $v['headers']['X']['maxCount']; $ii++) {
                        if ($headers['X'][ $ii ] != $headers['X'][ $ii - 1 ]) {
                            $uniquecount++;
                        }
                    }
                    $cols = $uniquecount + 1;


                    // dynamically compute Y unique row header ( row windowed size)
                    $uniquecount = 0;
                    for ($ii = 1; $ii < $v['headers']['Y']['maxCount']; $ii++) {
                        if ($headers['Y'][ $ii ] != $headers['Y'][ $ii - 1 ]) {
                            $uniquecount++;
                        }
                    }
                    //$rows = numcol=uniquecount+1;
                    $rows = $uniquecount + 1;


                    for ($ii = 0; $ii < $rows; $ii++) {
                        $kk = $v['cols'] * $ii * $width;

                        for ($j = 0; $j < $cols; $j++) {

                            // fetch 1 or 2 bytes
                            $lsb = 0;
                            $msb = 0;

                            if ($width == 1) {
                                $msb = base_convert("0x" . h($f, $v['sectorOffset'], $v['offset'] + $kk, 1), 16, 10);
                                $kk++;
                            }

                            if ($width == 2) {
                                $msb = base_convert("0x" . h($f, $v['sectorOffset'], $v['offset'] + $kk, 1), 16, 10);
                                $kk++;
                                $lsb = base_convert("0x" . h($f, $v['sectorOffset'], $v['offset'] + $kk, 1), 16, 10);
                                $kk++;
                            }


                            // calculate $val depending on convmode
                            $val = 0.0;
                            switch ($convmode) {
                                case 1:
                                    $val = ($msb * 256.0) + $lsb;
                                    break;
                                case 2:
                                    $val = $msb + ($lsb / 256.0);
                                    break;
                                case 3:
                                    $val = $msb + ($lsb / 100.0);
                                    break;
                                case 4:
                                    $val = $msb + ($lsb / 255.0);
                                    break;
                                case 5:
                                    $val = 1 * $msb;
                                    break;
                                case 6:
                                    $val = $msb;
                                    break;
                                case 7:
                                    $val = $msb;
                                    break;
                                case 8:
                                    $val = ($msb * 256.0) + $lsb;
                                    break;
                            }


                            // use formula to generate float value and store it
                            if ($convmode != 5) {
                                $fval = round((($factor * $val) / $divider) + $subtractor, $sigdig);
                            } else {
                                $fval = round(($factor / $val), $sigdig);
                            }


                            /*
                                                if($debug_proc==1) logger_procedural('log_decodeFile.txt', array('dbname'  => $dbname,
                                                                                                               'dataType'=> $v['dataType'],
                                                                                                               'msb'     => $msb,
                                                                                                               'lsb'     => $lsb,
                                                                                                               'convmode'=> $convmode,
                                                                                                               'val'     => $val,
                                                                                                               'fval'    => $fval
                                                                                                               ));
                            */


                            // store it
                            $arrayValues[ $dbname ][ $headers['X'][ $j ] ]  [ $headers['Y'][ $ii ] ] = $fval;

                        } // for - inner

                    }  // for - outer


                } //matrix


            }  // else for 'table', 'matrix'
        } // try
        catch (\Exception $e) {

        }
    }

    return $arrayValues;

} // decodeFile


//Get binary data from decimal value
function getBinData($value)
{
    $x = base_convert($value, 10, 16);
    if (strlen($x) % 2) {
        $x = '0' . $x;
    }

    return hextobin($x);
    //return hextobin(base_convert($value, 10, 16));
}

//Convert a hex-string to binary-string (the way back from bin2hex)
function hextobin($h)
{

    if (!is_string($h)) {
        return null;
    }
//  return hex2bin($h);
    $r = '';
    for ($a = 0; $a < strlen($h); $a += 2) {
        $r .= chr(hexdec($h{$a} . $h{($a + 1)}));
    }

    return $r;
}

function logger_procedural($fname, $fdata)
{
    $logPath = '../Temporary/_log';
    $logFile = $logPath . "/" . $fname;

    $lsm = fopen($logFile, "a");
    fwrite($lsm, date("m/d/Y h:i:s A") . ' ');
    fwrite($lsm, "\n" . json_encode($fdata) . "\n\n");
    fclose($lsm);
}


